DROP TABLE IF EXISTS `sys_application_record`;
CREATE TABLE `sys_application_record`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT,
  `job_no` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '工单号',
  `user_id` int(0) NULL DEFAULT NULL COMMENT '申请人id',
  `username` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '申请人姓名',
  `department_id` int(0) NULL DEFAULT NULL COMMENT '申请部门/申请单位id',
  `asset_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资产名称',
  `asset_type` int(0) NULL DEFAULT NULL COMMENT '资产类别',
  `num` int(0) NULL DEFAULT NULL COMMENT '数量',
  `units` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '单位',
  `budget_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '预算单价',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '具体描述',
  `flow_path` int(0) NULL DEFAULT NULL COMMENT '审批流程；-1：处理完毕，无需提交上级处理；正常情况为当前审批用户id',
  `status` int(0) NULL DEFAULT 0 COMMENT '0：待审批；1：通过；-1：驳回；2：主动撤销；-2：审批中',
  `create_time` bigint(0) NULL DEFAULT NULL,
  `update_time` bigint(0) NULL DEFAULT NULL,
  `specification` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '规格/型号',
  `relate_job_no` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '关联job_no，批量上传字段',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 493 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '资产申请表' ROW_FORMAT = Dynamic;

