  `del_flag` int(0) NULL DEFAULT 0,
  `out_num` int(0) NULL DEFAULT 0 COMMENT '出库数量',
  `charge_off_num` int(0) NULL DEFAULT 0 COMMENT '核销数量',
  `is_locked` int(0) NULL DEFAULT 0 COMMENT '锁定 0:未锁定 1:锁定',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1340 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '资产信息表' ROW_FORMAT = Dynamic;

